column8:
高精製パラフィンオイルとＰＴＦＥをベストバランスで配合した食品機械用潤滑剤です。<br>
食品機械の潤滑及び防錆に。<br>
<br>
●特長<br>
高精製パラフィンオイルとＰＴＦＥをベストバランスで配合した食品機械用潤滑剤です。<br>
従来のH1潤滑油を圧倒する付着性能・浸透性能を有しており、耐摩耗性能・潤滑性能において優れた効力を発揮します。<br>
<br>
●仕様<br>
第4石油類　危険等級3<br>
使用温度範囲：-15&#12316;196℃<br>
色:乳白色<br>
容量(ml):420<br>
使用温度範囲(℃):-15&#12316;196<br>
質量:390g<br>
<br>
●用途<br>
食品機械の潤滑及び防錆に。<br>
食品製造機械や製造ラインの摺動部など摩耗の激しい場所に。<br>
ご家庭内のきしみ音が気になるところに。<br>
<br>
●材質・仕上げ<br>
主成分：流動パラフィン、合成炭化水素油、ＰＴＦＥ、酸化防止剤<br>
<br>
●小箱入り数<br>
20本<style type="text/css">
